interface qParamObject {
    name: string,
    range: boolean,
    array: boolean,
}

interface qParamArray {
    objects: qParamObject[]
}

export const qParamArray = {
    objects:
    [
        {
            name: "title",
            range: false,
            array: false,
        },
        {
            name: "type",
            range: false,
            array: false,
        },
        {
            name: "created",
            range: true,
            array: false,
        },
        {
            name: "tag",
            range: false,
            array: true,
        },
    ]
}
